import React from 'react';
import './Navbar.css';

function Navbar() {
    return (
        <div className="nav">
            <img
                className="nav_logo"
                src="https://upload.wikimedia.org/wikipedia/commons/0/0f/Logo_Netflix.png"
                alt="Netflix_Logo"
            />

            <img
                className="nav_log"
                src="https://pbs.twimg.com/profile_images/1240119990411550720/hBEe3tdn_400x400.png"
                alt="Netflix_Logo"
            />

        </div>
    )
}

export default Navbar
